  false,\n\t\"url\": null,\n\t\"notes\": \"This report was written in order to better
  understand the possible effects of petroleum exploration, development, and related
  activities upon the bird resources of Alaska's Arctic Slope (North Slope). Information
  on birds from this region is summarized and discussed; the possible impact of petroleum
  development upon birds is discussed; and recommendations are made to the Bureau
  in order that it can better meet its legislative obligation to protect migratory
  birds.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
